import React, { useState } from 'react';
import { useAuth } from '../context/AuthContext';
import { useNavigate, Link } from 'react-router-dom';

const Register = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    password: '',
    phone: '',
    department: '',
    year: ''
  });
  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState('');
  const { register } = useAuth();
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleRegister = async (e) => {
    e.preventDefault();
    setLoading(true);
    setMessage('');

    const result = await register(formData);
    
    if (result.success) {
      setMessage('✅ Registration successful! Redirecting...');
      setTimeout(() => {
        navigate('/', { replace: true });
      }, 1000);
    } else {
      setMessage('❌ ' + result.message);
    }
    setLoading(false);
  };

  return (
    <div style={styles.container}>
      <div style={styles.card}>
        <div style={styles.header}>
          <h2 style={styles.title}>Create Your Account</h2>
          <p style={styles.subtitle}>Join EventHub and discover amazing events</p>
        </div>
        
        {message && (
          <div style={{
            padding: '14px 18px',
            borderRadius: '10px',
            marginBottom: '24px',
            background: message.includes('✅') ? 'linear-gradient(135deg, #d4edda, #c3e6cb)' : 'linear-gradient(135deg, #f8d7da, #f5c6cb)',
            color: message.includes('✅') ? '#155724' : '#721c24',
            border: `2px solid ${message.includes('✅') ? '#28a745' : '#dc3545'}`,
            fontWeight: '500',
            boxShadow: '0 4px 15px rgba(0,0,0,0.1)'
          }}>
            {message}
          </div>
        )}

        <form onSubmit={handleRegister} style={styles.form}>
          <input
            style={styles.input}
            type="text"
            name="name"
            placeholder="Full Name"
            value={formData.name}
            onChange={handleChange}
            required
          />

          <input
            style={styles.input}
            type="email"
            name="email"
            placeholder="Email Address"
            value={formData.email}
            onChange={handleChange}
            required
          />

          <input
            style={styles.input}
            type="password"
            name="password"
            placeholder="Password"
            value={formData.password}
            onChange={handleChange}
            required
          />

          <input
            style={styles.input}
            type="tel"
            name="phone"
            placeholder="Phone Number (Optional)"
            value={formData.phone}
            onChange={handleChange}
          />

          <input
            style={styles.input}
            type="text"
            name="department"
            placeholder="Department"
            value={formData.department}
            onChange={handleChange}
          />

          <select
            style={styles.input}
            name="year"
            value={formData.year}
            onChange={handleChange}
          >
            <option value="">Select Year</option>
            <option value="1st Year">1st Year</option>
            <option value="2nd Year">2nd Year</option>
            <option value="3rd Year">3rd Year</option>
            <option value="4th Year">4th Year</option>
          </select>

          <button
            type="submit"
            style={styles.button}
            disabled={loading}
            onMouseOver={(e) => !loading && (e.target.style.transform = 'translateY(-2px)')}
            onMouseOut={(e) => e.target.style.transform = 'translateY(0)'}
          >
            {loading ? 'Creating Account...' : 'Create Account'}
          </button>
        </form>

        <div style={styles.divider}>
          <span style={styles.dividerText}>or</span>
        </div>

        <div style={styles.link}>
          Already have an account?{' '}
          <Link to="/login" style={styles.linkText}>Sign in here</Link>
        </div>
      </div>
    </div>
  );
};

const styles = {
  container: {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    minHeight: '100vh',
    padding: '20px',
    background: 'linear-gradient(135deg, #38bdf8 0%, #7c3aed 100%)',
    position: 'relative',
    overflow: 'hidden'
  },
  card: {
    background: 'rgba(255,255,255,0.98)',
    padding: '45px 40px',
    borderRadius: '20px',
    boxShadow: '0 30px 80px rgba(0,0,0,0.3), 0 0 1px rgba(0,0,0,0.05)',
    maxWidth: '440px',
    width: '100%',
    backdropFilter: 'blur(10px)',
    border: '1px solid rgba(255,255,255,0.2)',
    position: 'relative',
    zIndex: 1
  },
  header: {
    textAlign: 'center',
    marginBottom: '35px'
  },
  title: {
    color: '#2d3748',
    marginBottom: '10px',
    fontSize: '32px',
    fontWeight: '700',
    letterSpacing: '-0.5px'
  },
  subtitle: {
    color: '#718096',
    fontSize: '15px',
    margin: 0
  },
  form: {
    display: 'flex',
    flexDirection: 'column',
    gap: '18px'
  },
  input: {
    width: '100%',
    padding: '14px 18px',
    border: '2px solid #e2e8f0',
    borderRadius: '12px',
    fontSize: '15px',
    color: '#2d3748',
    background: '#fff',
    transition: 'all 0.3s ease',
    fontFamily: 'inherit'
  },
  button: {
    padding: '16px',
    background: 'linear-gradient(135deg, #667eea, #764ba2)',
    color: 'white',
    border: 'none',
    borderRadius: '12px',
    fontSize: '16px',
    fontWeight: '700',
    cursor: 'pointer',
    marginTop: '10px',
    boxShadow: '0 10px 30px rgba(102,126,234,0.3)',
    transition: 'all 0.3s ease',
    textTransform: 'uppercase',
    letterSpacing: '0.5px'
  },
  divider: {
    position: 'relative',
    textAlign: 'center',
    margin: '28px 0 24px',
    borderTop: '1px solid #e2e8f0'
  },
  dividerText: {
    position: 'relative',
    top: '-12px',
    background: 'rgba(255,255,255,0.98)',
    padding: '0 15px',
    color: '#a0aec0',
    fontSize: '13px',
    fontWeight: '600'
  },
  link: {
    color: '#718096',
    textAlign: 'center',
    fontSize: '14px'
  },
  linkText: {
    color: '#667eea',
    textDecoration: 'none',
    fontWeight: '700',
    transition: 'color 0.2s'
  }
};

export default Register;
